(function(){
	function getData(ob){
		//parse word to sort
		word=jQuery(ob).text()
		word=word.replace(/[^a-zA-Z0-9]/g,'');
		word=word.replace('.','');
		word=word.toUpperCase();
		md5=jQuery.md5(word);
		md5=md5.substr(0,8);
		//reach data from pubmed_showtrenddata
		if(typeof(pubmed_showtrenddata[md5])=='object'){
			//return the change
			var o='<span style=\"border-bottom:1px solid red\"><span style=\"color:red\">'+pubmed_showtrenddata[md5][1]+'</span>';
			o+='&nbsp;R:'+pubmed_showtrenddata[md5][0]+';';
			o+='&nbsp;IF:<abbr title=\"'+pubmed_showtrenddata[md5][4]+'\">'+pubmed_showtrenddata[md5][2]+'</abbr>;';
			o+='&nbsp;AI:'+pubmed_showtrenddata[md5][3]+';</style>';
			return o;
		}else{
			return ob.innerHTML;
		}
	}
	jQuery('span.jrnl').each(function(i){
		this.innerHTML=getData(this);
	});
	jQuery('div.cit a').each(function(i){
		this.innerHTML=getData(this);
	});
})();